import React from 'react';
import instagram from '../images/instagram.png'
import facebook from '../images/facebook.png'

export default function SocialMedia({thisMidea, urlFaceBook, urlInstagran}) {
  return(
    <footer>
      <a href={ urlInstagran }>
        <img 
        alt="Instagran"
        src={ instagram }
        width="50px"
        />
      </a>
      { thisMidea ? (  
        <a href={ urlInstagran }>
          <img
          alt="Facebook"
          src={ facebook }
          width="50px"
          />
        </a>     
        ) : null
      }
    </footer>
  );
}
